import React, { Component } from 'react';

class Featured extends Component {

	constructor(props){
	  super(props)
	  this.state = {onHighLight: "tittle"}
	}	

	mouseEnter = () => {
		console.log('enter')
		//return current project
		//this.props.hoverDisplay("river")
		this.setState({
	      onHighLight: "tittle onlight"
	    })		
	}
	mouseExit = () => {
		console.log('exit')
		//clear current
		this.setState({
	      onHighLight: "tittle"
	    })		
	}

	render() {
		let tittle = this.state.onHighLight
		return(
			<div className= "featured">
				<div className = "highlight onhighlight" onClick={this.props.toggleDisplay} onMouseEnter={this.mouseEnter} onMouseLeave={this.mouseExit}>	
					<h4 className= "tittle">
						river
					</h4>
				</div>
				<div className = "highlight" onClick={this.props.toggleDisplay} onMouseEnter={this.mouseEnter} onMouseLeave={this.mouseExit}>	
					<h4 className="tittle">
						double dog
					</h4>				
				</div>
				<div className = "highlight" onClick={this.props.toggleDisplay} onMouseEnter={this.mouseEnter} onMouseLeave={this.mouseExit}>	
					<h4 className="tittle">
						matchmaking
					</h4>				
				</div>
				<div className = "highlight spotlight">
					<h5>
						hover over the featured projects to learn more about them. click on the project to get more indeph information.
					</h5>
				</div>											 
			</div>
		)
	}
}

export default Featured
